       [id]
      ,[etiqueta]
      ,[geometry]
      ,[delegacion]
      ,[zona]
)
  SELECT     
	   [ogr_fid]
      ,[nombre]
      ,[ogr_geometry].STAsText( )  
      ,[delegacion]
      ,[zona]
FROM [MPN2].[dbo].[sspdf_sectores_2017]
SET IDENTITY_INSERT [mpn].[dbo].[Sector] OFF
   

SELECT UPPER(LEFT(zona,1))+LOWER(SUBSTRING(zona,2,LEN(zona))) FROM [mpn].[dbo].[Sector]
UPDATE [mpn].[dbo].[Sector]
SET zona=UPPER(LEFT(zona,1))+LOWER(SUBSTRING(zona,2,LEN(zona)))


SET  IDENTITY_INSERT Zona ON  
SET  IDENTITY_INSERT Zona OFF 


     [id_Zona]      
      ,[id_Sector]
)
SELECT zon.id
		,sec.id
FROM [mpn].[dbo].[Sector] sec
INNER JOIN mpn.dbo.zona zon on zon.etiqueta = sec.zona






