SET IDENTITY_INSERT [mpn].[dbo].[Negocio] ON
       [id]
      ,[nombre]
      ,[razonSocial]
      ,[comentarios]
      ,[piso]
      ,[referencia]
      ,[latitud]
      ,[longitud]
      ,[telefono]
      ,[ext]
      ,[codigoAguila]
      ,[status]
      ,[fechaAlta]
      ,[delegacionDePaso]
      ,[coloniaDePaso]
      ,[id_Direccion]
      ,[id_TipoNegocio]
      ,[id_GironeGegocio]
      ,[id_GiroNegocioGeneral]
      ,[id_Plaza]
      ,[id_TipoStatus]
      ,[id_StatusRevisionNegocio]
      ,[numeroDeEstablecimientos]
      ,[placaMPN]
      ,[id_Sector] 
)
SELECT 
	   neg.[id]
      ,neg.[nombre]
      ,neg.[razonSocial]
      ,neg.[comentarios]
      ,neg.[piso]
      ,neg.[referencia]
      ,neg.[latitud]
      ,neg.[longitud]
      ,neg.[telefono]
      ,neg.[ext]
      ,0
      ,neg.[status]
      ,neg.[fechaAlta]
      ,neg.[delegacionDePaso]
      ,neg.[coloniaDePaso]
      ,neg.[id_Direccion]
      ,neg.[id_TipoNegocio]
      ,neg.[id_GironeGegocio]
      ,neg.[id_GiroNegocioGeneral]
      ,neg.[id_Plaza]
      ,neg.[id_TipoStatus]
      ,neg.[id_StatusRevisionNegocio]
      ,neg.[numeroDeEstablecimientos]
      ,neg.[placaMPN]
	 ,sec.id
FROM [MPN2].[dbo].[Negocio] neg
LEFT JOIN mpn.dbo.Sector sec on geometry::STGeomFromText( sec.geometry , 4326).STIntersects(  geometry::Point(neg.[longitud], neg.[latitud], 4326) ) = 1
SET IDENTITY_INSERT [mpn].[dbo].[Negocio] OFF
 




